import React, { useState } from 'react';
import './styles.scss';
NavBar.propTypes = {};

function NavBar(props) {
	const [mode, setMode] = useState('');
	return (
		<ul className='nav-bar-control d-flex  '>
			<li
				onClick={() => setMode('all')}
				className='color-darkslategray modeText'
			>
				All
			</li>
			<li className='color-darkslategray modeText'>Active</li>
			<li className='color-darkslategray modeText'>Completed</li>
		</ul>
	);
}

export default NavBar;
